class Solution {
    public String[] replace(String[] arr) {
        if (arr == null || arr.length <= 0) return new String[0];

        int len = arr.length;
        for (int i = 0; i < len - 1; i++) {
            if (arr[i].equals("a") &&!arr[i + 1].equals("a")) {
                int j = i + 1;
                while (j < len &&!arr[j].equals("a")) j++;
                // copy the value of arr[i] to all elements between [i, j-1]
                for (int k = i + 1; k < j; k++) arr[k] = arr[i];
            }
        }

        return arr;
    }
}

